PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE `building` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `name` VARCHAR, `address` VARCHAR , `coordX` DOUBLE PRECISION , `coordY` DOUBLE PRECISION , `width` INTEGER , `height` INTEGER , `aliases` VARCHAR , `imageResource` VARCHAR , `markerImageResource` VARCHAR);
CREATE TABLE `buildingEntry` (`id` INTEGER PRIMARY KEY, `coordX` INTEGER, `coordY` INTEGER , `building_id` INTEGER , `point_id` INTEGER);
CREATE TABLE `floor` (`id` INTEGER PRIMARY KEY, `name` VARCHAR, `building_id` INTEGER, `number` INTEGER, `width` INTEGER , `height` INTEGER , `drawableId` VARCHAR, `tag` VARCHAR, `pixelsPerMeter` INTEGER);
CREATE TABLE `room` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `number` VARCHAR, `name` VARCHAR, `function` VARCHAR , `floor_id` INTEGER , `coordX` INTEGER , `coordY` INTEGER , `radius` INTEGER, `doorsX` INTEGER , `doorsY` INTEGER , `navigationPointConnection_id` INTEGER , `aliases` VARCHAR , `building_id` INTEGER);
CREATE TABLE `navigationPoint` (`id` INTEGER PRIMARY KEY, `coordX` INTEGER, `coordY` INTEGER, `floor_id` INTEGER, `type` VARCHAR);
CREATE TABLE `navigationConnection` (`id` INTEGER PRIMARY KEY, `navigationPointFirst_id` INTEGER , `navigationPointLast_id` INTEGER, `length` INTEGER);
CREATE TABLE `specialConnection` (`id` INTEGER PRIMARY KEY, `specialPointLower_id` INTEGER, `specialPointUpper_id` INTEGER);
CREATE TABLE `unit` (`aliases` VARCHAR , `building_id` INTEGER , `www` VARCHAR , `name` VARCHAR , `room_id` INTEGER , `type` VARCHAR , `id` INTEGER PRIMARY KEY);
DELETE FROM sqlite_sequence;
CREATE INDEX `room_aliases_idx` ON `room` ( `aliases` );
CREATE INDEX `room_name_idx` ON `room` ( `name` );
CREATE INDEX `room_number_idx` ON `room` ( `number` );
CREATE INDEX `unit_aliases_idx` ON `unit` ( `aliases` );
CREATE INDEX `unit_name_idx` ON `unit` ( `name` );
CREATE INDEX `building_name_idx` ON `building` ( `name` );
CREATE INDEX `building_aliases_idx` ON `building` ( `aliases` );
COMMIT;
